import React, { useState } from "react";
import { StyleSheet, View, Text, Image } from 'react-native'
import "./assets/css/main.css";
import Axios from 'axios'


const SignUpComplete = () => {

  return (
	<View>
		<View>
		<View style={styles.middle}>
				<Text style={styles.title}>Вітаємо!</Text>
			</View>
			<Image source={require("../assets/success.png")} style={{
					width: '68%', marginLeft: '16%', height: '68%'
				}} />
			<View style={styles.middle}>
				<Text style={styles.title2}>Реєстрація завершена</Text>
			</View>

			<form action="" onSubmit={handleSubmit}>
				<View style={styles.spaceBtn}>
					<View style={styles.btn}>
						<View style={styles.middleBtn}>
							<View style={styles.middleBtn} onClick={handleSubmit}>
								<Text style={styles.textBtn}>Старт</Text>
							</View>
						</View>
					</View>
				</View>
			</form>
		</View>
	</View>
  )
}

const styles = StyleSheet.create({
	middle: {
		alignItems: 'center',
	},
	title: {
		fontWeight: 600,
		fontSize: 40,
		marginTop: "37%",
		marginBottom: "5%",
	},
	title2: {
		fontSize: 30,
		marginTop: "4.8%",
		marginBottom: "3.1%",
	},
	spaceBtn: {
		marginTop: 10,
		backgroundColor: '#f2f2f2',
		alignItems: 'center',
	},
	btn: {
		width: 260,
		height: 60,
		borderRadius: 35,
		backgroundColor: '#5c358f',
		alignItems: 'center',
	},
	middleBtn: {
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'center',
		justifyContent: 'space-between',
		height: 60,
	},
	textBtn: {
		fontSize: 25,
		fontWeight: 500,
		color: 'white',
		paddingRight: 8,
		paddingLeft: 8,
		paddingBottom: 5,
	},
});

export default SignUpComplete
